INSERT INTO `report` VALUES (1,'cajas x periodo','SELECT  id, closed as Cierre,  calculated_sale as Ventas, registered_sale as Registradas,  expenses as Gastos, cash_extraction as Extraido \nFROM cash \nWHERE (status = :status ) \nAND closed >= :start \nAND closed <= :end  \nUNION \nSELECT \'\' as id,\'Total\' as Cierre,  SUM(calculated_sale) as Ventas, SUM(registered_sale) as Registrada, SUM(expenses) as Gastos, SUM(cash_extraction) as Extraido \nFROM cash \nWHERE (status = :status ) \nAND closed >= :start \nAND closed <= :end ','{\"0\":{\"name\":\"status\",\"description\":\"Estado\",\"type\":\"select\",\"defval\":[{\"value\":\"closed\", \"description\":\"cerrado\"},{\"value\":\"open\", \"description\":\"abierto\"},{\"value\": \"frozen\",\"description\": \"congelado\"}]},\n\"2\":{\"name\":\"start\",\"description\":\"Desde\",\"type\":\"datetime\",\"defval\":\"\"},\n\"3\":{\"name\":\"end\",\"description\":\"Hasta\",\"type\":\"datetime\",\"defval\":\"\"}}'),(2,'consumos x periodo','SELECT  \"\" as Cierre,\"Total\" as Mesa, \"\" as Tipo, SUM(subtotal) as Subtotal, SUM(discount) as Descuento, SUM(total) as Total, \"\" as Estado\nFROM consumption \n\n\nWHERE (status =:status ) \nAND closed >= :start \nAND closed <= :end \nUNION\nSELECT  closed as Cierre, table_description as Mesa, consumption_type_description as Tipo, subtotal, discount, total, status\nFROM consumption \nWHERE (status =:status ) \nAND closed >= :start \nAND closed <= :end ','{\"0\":{\"name\":\"status\",\"description\":\"Estado\",\"type\":\"select\",\"defval\":[{\"value\":\"close\", \"description\":\"cerrado\"},{\"value\":\"open\", \"description\":\"abierto\"}]},\n\"2\":{\"name\":\"start\",\"description\":\"Desde\",\"type\":\"datetime\",\"defval\":\"\"},\n\"3\":{\"name\":\"end\",\"description\":\"Hasta\",\"type\":\"datetime\",\"defval\":\"\"}}'),(3,'Consumos x caja','SELECT , ca.id Caja, ca.registered_sale CaTotal, co.id Consumo, co.table_description Mesa,co.subtotal, co.discount \'Desc\', co.total CoTotal, co.Status Estado FROM consumption co LEFT OUTER JOIN cash ca ON co.closed > ca.open AND co.closed < ca.closed WHERE co.Status=\'Close\'','{}');
